// utils/invoice.ts
import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';

// Logo de l'entreprise en base64 - Remplacez par votre base64 complet
const COMPANY_LOGO = 'data:image/png;base64,';

export type OrderLine = {
  product_name: string;
  product_category?: string;
  quantity: number;
  price_ttc: number;
  price_ht: number;
};

export type InvoiceInput = {
  transaction_id: string;
  invoice_number?: string;
  created_at: string;
  venue_name?: string;
  order_lines: OrderLine[];
  payment_method?: string;
  customer_email?: string;
  promo_code?: string;
  discount_amount?: number;
  total_ht: number;
  total_ttc: number;
  total_tva: number;
};

// Configuration de l'entreprise
const COMPANY = {
  name: 'SHAPE EAT',
  address1: '2, rue de Corse',
  address2: '93600 Aulnay-sous-bois, France',
  siret: 'SIRET: 920 989 928 00022',
  //vat: 'TVA Intracommunautaire: FR XX XXXXXXXXX',
  email: 'contact@shape-eat.fr',
  website: 'www.shape-eat.fr'
};

// Génération du numéro de facture
export function generateInvoiceNumber(date: Date, transactionId: string): string {
  const year = date.getFullYear();
  const month = String(date.getMonth() + 1).padStart(2, '0');
  const day = String(date.getDate()).padStart(2, '0');
  const shortId = transactionId.slice(-4).toUpperCase();
  return `FAC-${year}${month}${day}-${shortId}`;
}

export async function generateInvoicePDF(input: InvoiceInput): Promise<{ blob: Blob; filename: string }> {
  const doc = new jsPDF();
  const dateObj = new Date(input.created_at);
  const invoiceNumber = input.invoice_number || generateInvoiceNumber(dateObj, input.transaction_id);
  
  // Couleurs définies
  const darkColor = [33, 41, 60]; // #212122 pour l'en-tête
  const accentColor = [153, 202, 189]; // #52b69a couleur secondaire
  const grayColor = [107, 114, 128]; // gray-500
  
  // En-tête simple avec couleur #597686
  doc.setFillColor(...darkColor);
  doc.rect(0, 0, 210, 40, 'F');
  
  // AJOUT DU LOGO avec dimensions fixes non déformées
  const hasLogo = COMPANY_LOGO !== 'data:image/png;base64,REMPLACEZ_PAR_VOTRE_BASE64';
  if (hasLogo) {
    try {
      // Logo
      doc.addImage(COMPANY_LOGO, 'PNG', 9, 2, 70, 40);
    } catch (error) {
      console.warn('Erreur lors de l\'ajout du logo:', error);
    }
  }
  
  // Site web seulement
  doc.setTextColor(255, 255, 255);
  doc.setFontSize(10);
  doc.setFont('helvetica', 'normal');
  doc.text(COMPANY.website, hasLogo ? 90 : 14, 38);
  
  // Titre FACTURE avec couleur accent
  doc.setTextColor(255, 255, 255);
  doc.setFontSize(20);
  doc.setFont('helvetica', 'bold');
  doc.text('FACTURE', 150, 23);
  
  // Reset couleur texte
  doc.setTextColor(0, 0, 0);
  
  // Informations entreprise
  doc.setFontSize(10);
  doc.setFont('helvetica', 'normal');
  let yPos = 50;
  
  // Colonne gauche - Émetteur
  doc.setFont('helvetica', 'bold');
  doc.text('EMETTEUR', 14, yPos);
  doc.setFont('helvetica', 'normal');
  yPos += 6;
  doc.text(COMPANY.name, 14, yPos);
  yPos += 5;
  doc.text(COMPANY.address1, 14, yPos);
  yPos += 5;
  doc.text(COMPANY.address2, 14, yPos);
  yPos += 5;
  doc.text(COMPANY.siret, 14, yPos);
  yPos += 5;
  //doc.text(COMPANY.vat, 14, yPos);
  //yPos += 5;
  doc.text(`Email: ${COMPANY.email}`, 14, yPos);
  
  // Colonne droite - Détails facture
  yPos = 50;
  doc.setFont('helvetica', 'bold');
  doc.text('DETAILS FACTURE', 120, yPos);
  doc.setFont('helvetica', 'normal');
  yPos += 6;
  doc.text(`N° Facture: ${invoiceNumber}`, 120, yPos);
  yPos += 5;
  doc.text(`Date: ${dateObj.toLocaleDateString('fr-FR')}`, 120, yPos);
  yPos += 5;
  doc.text(`Heure: ${dateObj.toLocaleTimeString('fr-FR', { hour: '2-digit', minute: '2-digit' })}`, 120, yPos);
  yPos += 5;
  doc.text(`Transaction: ${input.transaction_id}`, 120, yPos);
  if (input.venue_name) {
    yPos += 5;
    doc.text(`Lieu: ${input.venue_name}`, 120, yPos);
  }
  if (input.payment_method) {
    yPos += 5;
    doc.text(`Paiement: ${input.payment_method}`, 120, yPos);
  }
  
  // CLIENT
  yPos += 15;
  doc.setFont('helvetica', 'bold');
  doc.text('CLIENT', 14, yPos);
  doc.setFont('helvetica', 'normal');
  yPos += 6;
  
  if (input.customer_email) {
    doc.text(`Email: ${input.customer_email}`, 14, yPos);
    yPos += 5;
    doc.text(`Lieu de vente: ${input.venue_name || 'Non spécifié'}`, 14, yPos);
  } else {
    doc.text('Vente directe sur distributeur automatique', 14, yPos);
    yPos += 5;
    doc.text(`Lieu: ${input.venue_name || 'Non spécifié'}`, 14, yPos);
  }
  
  // Ligne de séparation
  yPos += 10;
  doc.setDrawColor(...grayColor);
  doc.line(14, yPos, 196, yPos);
  
  // Table des produits
  yPos += 10;
  
  // Préparation des données du tableau
  const tableData = input.order_lines.map(line => [
    line.product_name,
    line.product_category || '-',
    line.quantity.toString(),
    `${line.price_ht.toFixed(2)} €`,
    `${line.price_ttc.toFixed(2)} €`
  ]);
  
  // Ajout du code promo si présent
  if (input.promo_code && input.discount_amount) {
    tableData.push([
      `Code promo: ${input.promo_code}`,
      '-',
      '1',
      `-${input.discount_amount.toFixed(2)} €`,
      `-${input.discount_amount.toFixed(2)} €`
    ]);
  }
  
  // GÉNÉRATION DU TABLEAU avec couleur accent pour les en-têtes
  autoTable(doc, {
    startY: yPos,
    head: [['Produit', 'Catégorie', 'Qté', 'Prix HT', 'Prix TTC']],
    body: tableData,
    theme: 'grid',
    headStyles: {
      fillColor: accentColor, // Couleur accent #52b69a pour les en-têtes
      textColor: [255, 255, 255],
      fontStyle: 'bold',
      fontSize: 10,
      halign: 'center'
    },
    bodyStyles: {
      fontSize: 9,
      textColor: [0, 0, 0]
    },
    columnStyles: {
      0: { cellWidth: 70, halign: 'left' },
      1: { cellWidth: 40, halign: 'center' },
      2: { cellWidth: 20, halign: 'center' },
      3: { cellWidth: 30, halign: 'right' },
      4: { cellWidth: 30, halign: 'right' }
    }
  });
  
  // Récupération de la position Y après le tableau
  const finalY = (doc as any).lastAutoTable.finalY || yPos + 50;
  
  // Totaux avec style amélioré
  const totalsY = finalY + 15;
  doc.setFillColor(248, 250, 252);
  doc.rect(110, totalsY - 5, 86, 35, 'F');
  
  // Bordure accent sur le côté gauche
  doc.setFillColor(...accentColor);
  doc.rect(110, totalsY - 5, 3, 35, 'F');
  
  doc.setTextColor(0, 0, 0);
  doc.setFont('helvetica', 'normal');
  doc.text('Total HT:', 115, totalsY);
  doc.text(`${input.total_ht.toFixed(2)} €`, 180, totalsY, { align: 'right' });
  
  doc.text('TVA:', 115, totalsY + 8);
  doc.text(`${input.total_tva.toFixed(2)} €`, 180, totalsY + 8, { align: 'right' });
  
  // Total TTC avec couleur accent
  doc.setTextColor(...accentColor);
  doc.setFont('helvetica', 'bold');
  doc.setFontSize(12);
  doc.text('TOTAL TTC:', 115, totalsY + 20);
  doc.text(`${input.total_ttc.toFixed(2)} €`, 180, totalsY + 20, { align: 'right' });
  
  // MENTIONS LÉGALES
  const footerY = 270;
  doc.setFont('helvetica', 'bold');
  doc.setFontSize(9);
  doc.setTextColor(0, 0, 0);
  
  doc.text('Conditions de paiement :', 14, footerY);
  
  doc.setFont('helvetica', 'normal');
  doc.setFontSize(8);
  doc.text('Paiement comptant effectué sur distributeur automatique', 14, footerY + 5);
  doc.text(`Transaction sécurisée et validée le ${dateObj.toLocaleDateString('fr-FR')} à ${dateObj.toLocaleTimeString('fr-FR', { hour: '2-digit', minute: '2-digit' })}`, 14, footerY + 9);
  doc.setFont('helvetica', 'bold');
  doc.text('Cette facture fait office de justificatif de paiement.', 14, footerY + 13);
  
  // Ligne de séparation footer
  doc.setDrawColor(...grayColor);
  doc.line(14, footerY - 5, 196, footerY - 5);
  
  // Génération du blob
  const blob = doc.output('blob');
  const filename = `${invoiceNumber}.pdf`;
  
  return { blob, filename };
}